"original": |2-
     $ Internet Assigned Numbers Authority (IANA)
        (I) From the early days of the Internet, the IANA was chartered by
        the ISOC and the U.S. Government's Federal Network Council to be
        the central coordination, allocation, and registration body for
        parameters for Internet protocols. Superseded by ICANN.
"fixed": |-
  $ Internet Assigned Numbers Authority (IANA)  -  (I) From the early days of the Internet, the IANA was chartered by the ISOC and the U.S. Government's Federal Network Council to be the central coordination, allocation, and registration body for parameters for Internet protocols. Superseded by ICANN.
"ko": |-
  $ IANA(인터넷 할당 번호 관리 기관) - (I) 인터넷 초기부터 IANA는 ISOC와 미국 정부의 연방 네트워크 협의회에 의해 인터넷 프로토콜 매개 변수에 대한 중앙 조정, 할당 및 등록 기관으로 인가되었습니다. . ICANN으로 대체되었습니다.
